import React from 'react';
import './App.css';
import Navbar from './Navbar';

function App() {
  return (
    <div className="App">
      <Navbar></Navbar>
      <h1>Joel Hilton's Movie site</h1>
      <img src="../public/JoelHiltonHeadshot.jpg/" alt="Joel Hilton Headshot" />
    </div>
  );
}

export default App;
